import { useState } from "react";
import List from "./List";

const TreeList = ({ data }) => {
  const [toggleList, setToggle] = useState(false);

  return (
    <div className="list">
      <h5>Checking the list view</h5>
      {Object.keys(data).length ? <List list={data} /> : "No List"}
    </div>
  );
};

export default TreeList;
